import React, { Component } from 'react';
import Menu from './../Menu/Menu';

class Sidebar extends Component {
    render() {
        return (
            <div>
                {/**/}
                <div className="page-sidebar " id="main-menu">

                    <div className="page-sidebar-wrapper scrollbar-dynamic" id="main-menu-wrapper">
                        <div className="user-info-wrapper sm">
                            <div className="profile-wrapper sm">
                                <img src="images/profiles/avatar.jpg" alt="" data-src="images/profiles/avatar.jpg" data-src-retina="assets/img/profiles/avatar2x.jpg" width="69" height="69" />
                                <div className="availability-bubble online"></div>
                            </div>
                            <div className="user-info sm">
                                <div className="username">Fred <span className="semi-bold">Smith</span></div>
                                <div className="status">Life goes on...</div>
                            </div>
                        </div>
                            <p className="menu-title sm"> BROWSE <span className="pull-right"><a href="/home"><i className="material-icons">refresh</i></a></span></p>

                        <Menu /> 



                        <div className="clearfix"></div>

                    </div>
                </div>

            </div>
        );
    }
}

export default Sidebar;
